import React from 'react'

const NewTodoForm = (props) => {
  return (

            <form onSubmit={(event) => props.formSubmitted(event)}>

            <input
                onChange={(event) => props.newTodoChanged(event)}
                id="newTodo"
                name="newTodo"
                value={props.newTodo}
                />

              <button type="submit">Add Todo</button>


            </form>
  )
}

export default NewTodoForm
